import MediaPlayer from './components/MainComponents/MediaPlayer';
import Visualizer from './components/MainComponents/Visualizer';
import CookieConsent from "react-cookie-consent";

const App = () => {
  return (
    <main className="container-md">
      <div className="row justify-content-md-center justify-content-lg-center">
        <div className="col-md-5 col-lg-5">
          <MediaPlayer className="MediaPlayer" />
        </div>
      </div>
      <div className="row justify-content-md-center justify-content-lg-center">
        <div className="col-md-5 col-lg-5">
          <Visualizer />
        </div>
      </div>
      <CookieConsent>This site uses cookies.</CookieConsent>
    </main >
  )
}

export default App;
